import React from "react";
import { inject, observer } from "mobx-react";

const ListItem01 = inject("RouteStore")(
  observer(
    ({
      RouteStore,
      navigateTo,
      imgSrc,
      isLive,
      title,
      textPrimary,
      location,
    }) => {
      const go = (pathname) => {
        RouteStore.go(pathname);
      };
      return (
        <li className="item">
          <a onClick={() => go(navigateTo)}>
            <div className="imgWrap">
              <img src={imgSrc} className="img-fluid" alt="" />
              {isLive && (
                <>
                  <span className="play">
                    <img src="/assets/img/svg/live-play.svg" alt="" />
                  </span>
                  <span className="play-live">LIVE</span>
                </>
              )}
            </div>
            <div className="InfoWrap">
              <h6>{title}</h6>
              <p>
                <strong className="text-primary">{textPrimary}</strong>
                {location}
              </p>
            </div>
          </a>
        </li>
      );
    }
  )
);

export default ListItem01;
